import React, {useState, useEffect} from 'react'

const UserProfile = () => {
    const [userColumns, setUserColumns] = useState([]);
    const [record, setRecord] = useState([]);
    const [addressColumns, setAddressColumns] = useState([]);
    const [addresses, setAddresses] = useState([]);
    const [phoneColumns, setPhoneColumns] = useState([]);
    const [phones, setPhones] = useState([]);
    const [infoColumns, setInfoColumns] = useState([]);
    const [info, setInfo] = useState([]);


    useEffect(() => {
        fetch('http://localhost:8000/users/user/1')
        .then(res => res.json())
        .then(data => {
            setUserColumns(Object.keys(data.user))
            setRecord(data.user)
            setInfo(data.info)
            setAddresses(data.addresses)
            setPhones(data.phones)
        })
        .catch(error => console.error(error));
    }, []);

  return (
    <div>
        <h2>User</h2>
        <table className='table'>
            <thead>
                <tr>
                    {
                        userColumns.map((c, i) => (<th key={i}>{c}</th>))
                    }
                </tr>
            </thead>
            <tbody>
                {
                    <tr>
                        <td>{record.user_id}</td>
                        <td>{record.first_name}</td>
                        <td>{record.last_name}</td>
                        <td>{record.email}</td>
                        <td class="hidetext">{record.pass_word}</td>
                        <td>{record.created_date}</td>
                        <td>{record.is_active}</td>
                        <td>{record.last_login}</td>
                    </tr>
                }
            </tbody>
        </table>
    </div>
  )
}

export default UserProfile
